import logo from './logo.svg';
import './App.css';
import Input from './sapp';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Routes>
        <Route path="/" element={<Input/>}/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
